(8, '183250775019411_408504147889683', 'share', 'share', 'Greenery hay xanh lá cây ánh vàng gợi chúng ta cảm giác của những ngày đầu tiên của mùa xuân, khi mà những dấu hiệu đầu tiên của thiên nhiên và cuộc sống thực vật hoạt động trở lại sau một mùa đông lạnh lẽo.\n\nNó cũng gợi nhiều liên tưởng tới hình ảnh tán lá, từ đó tạo nên cảm giác về sự trong lành, tươi mát giúp bạn phục hồi sinh lực cho công việc và cuộc sống của mình. Greenery cũng là một màu đa năng khi có thể kết hợp với hàng loạt màu sắc khác. Chúng ta có thể dễ dàng bắt gặp nó xuất hiện cùng với các màu trung tính, màu đậm trên các tác phẩm sử dụng đổ bóng sâu, chì màu hay kim loại.', '183250775019411', 4, 4, 0, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:05', '2024-10-01 23:28:05', 0, NULL),
