(20, '335323586336510_122134498676361405', 'share', 'share', 'As the leaves turn to gold and the air grows crisp in October, something spectacular brews above us, inviting stargazers and casual observers alike to tilt their heads skyward. October 2024 is poised to serve up an astronomical feast unlike any other, boasting a dazzling array of celestial events. This month, our night sky gifts us with a rare naked-eye comet, a magical annular solar eclipse, the grandest supermoon of the year, and a fiery display from the Orionid meteor shower. It’s a cosmic cornucopia that promises to captivate hearts and spark imaginations.', '335323586336510', 2, 2, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:08', '2024-10-01 23:28:08', 0, NULL),
(21, '335323586336510_122134451996361405', 'share', 'share', 'On a brisk October morning, business enthusiasts and market analysts alike sharpened their pencils and prepared their notepads, eagerly anticipating the Q3 2024 results of DSV A/S. The air was thick with anticipation as whispers circulated about potential growth and performance insights. DSV, a global leader in logistics and freight transportation, had cultivated a reputation for transparency and strategic foresight. As the clock struck 11:00 am CEST on October 23, 2024, stakeholders poured into the virtual conference room, drawn in by the promise of insights that could maneuver investments in unpredictable waters.', '335323586336510', 54, 54, 2, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:09', '2024-10-01 23:28:09', 3, NULL),
(22, '335323586336510_122134325000361405', 'video_inline', 'reel', 'Why the Pixel Watch 3 is a Game-Changer for Android Users!\nPixel Watch 3 is making waves in the smartwatch market with its sleek design and outstanding features tailored for Android users. From health tracking and smart notifications to high customization options, this is definitely an essential accessory for tech lovers. Don’t miss the chance to experience the perfect blend of style and functionality!\n#PixelWatch3 #SmartWatch #Android #Technology #WearableTech #Health #Fashion #NewTech #Gadgets #TechExperience', '335323586336510', NULL, NULL, NULL, 0, 0, 0, 27207, 0, 652971, NULL, NULL, NULL, NULL, '2024-10-01 23:28:10', '2024-10-01 23:28:10', NULL, NULL),
(23, '335323586336510_122134317104361405', 'share', 'share', 'In a digital world teeming with opportunities, a sinister plot unfolded recently, stealing the spotlight from genuine cryptocurrency tools. Check Point Research (CPR) uncovered a furtive app posing as WalletConnect, a widely trusted protocol, on the Google Play Store. Dubbed ‘MS Drainer,’ this malicious software has reportedly drained over $70,000 (around Rs 58.6 lakh) from unsuspecting users’ crypto wallets in just five months, marking a significant evolution in cybercrime tactics. Like a wolf in sheep’s clothing, this app took advantage of its sophisticated camouflage, utilizing evasion strategies that tricked many into putting their financial security on the line.', '335323586336510', 12, 12, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:11', '2024-10-01 23:28:11', 1, NULL),
(24, '335323586336510_122134307450361405', 'share', 'share', 'The sun peeked through the clouds on that tense October afternoon, casting a golden hue over Olney, a small town that would soon become a symbol of baseball’s wildest and most dramatic conclusions. As residents shuffled about their business, whispers of a thrilling double-header danced through the brisk autumn air, hinting at what was to unfold—a day that would change the course of the Major League Baseball season in ways nobody could have predicted. At the heart of this whirlwind was the Olney Raptors, facing the daunting prospect of a double-header against the fierce city rivals, the River Rats. Little did anyone know that this was not merely about wins and losses; it was about heart, rivalry, and the timeless spirit of the game.', '335323586336510', 18, 18, 2, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:13', '2024-10-01 23:28:13', 2, NULL),
(25, '335323586336510_122134255934361405', 'share', 'share', 'It all started on a Friday evening, a typical night ripe with the promise of cinematic escapism. I had gathered with friends to catch the latest blockbuster, a thrilling adventure filled with high-speed chases and unexpected plot twists. Little did I know, this seemingly innocent outing would lead me down a rabbit hole of confusion, outrage, and ultimately, bizarre revelations', '335323586336510', 11, 11, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:13', '2024-10-01 23:28:13', 1, NULL),
(26, '335323586336510_122134232486361405', 'video_inline', 'reel', 'Epic Holiday Savings: LEGO Star Wars Advent Calendar for £14!\nAs the holiday season approaches, the hustle and bustle of Christmas shoppers fills the air with an electric anticipation. This is a time of twinkling lights, festive melodies, and, for many, the joy of finding the perfect gifts. Among the long list of holiday treasures, one item shines a bit brighter than the rest—the LEGO Star Wars Advent Calendar. But what if I told you that this coveted calendar, known for its charm and creativity, could grace your home without breaking the bank? That’s right! Thanks to an irresistible deal, you can snag this delightful calendar for only £14, saving you over £16 and doubling your festive cheer.', '335323586336510', NULL, NULL, NULL, 0, 0, 0, 4408, 0, 114612, NULL, NULL, NULL, NULL, '2024-10-01 23:28:14', '2024-10-01 23:28:14', NULL, NULL),
(27, '335323586336510_122134105100361405', 'video_inline', 'videos', 'We’re just days away from the launch of the Vivo X200 series on October 14! The stunning new design has been unveiled, promising to bring exciting features that will captivate users. With significant upgrades in both aesthetics and functionality, the Vivo X200 is set to make waves in the smartphone market. Join us as we dive into the unique highlights and what to expect in this highly anticipated release!\n\n#VivoX200 #Smartphone #TechNews #LaunchEvent #Innovation #MobileTech #Gadgets #DesignReveal #FutureTech #Vivo', '335323586336510', NULL, NULL, NULL, 0, 1, 10, 9, 8, 2, NULL, NULL, NULL, NULL, '2024-10-01 23:28:15', '2024-10-01 23:28:15', NULL, NULL),
(28, '335323586336510_122134100666361405', 'share', 'share', 'As the sun began to dip below the iconic skyline of Newcastle, casting a warm golden hue over St. James’ Park, excitement was palpable in the air. The roar of the crowd reverberated, echoing the passion that comes with yet another intense battle in the Premier League as Newcastle United prepared to face off against Manchester United. But beyond the rivalries and heroics on the pitch, for many fans, the stakes were amplified by their betting slips, a growing trend that adds an electrifying layer to the vibrant tapestry of football. If you’re planning on placing bets for this titanic showdown, let’s dive into the best tips and insights the experts have to offer.', '335323586336510', 19, 19, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:16', '2024-10-01 23:28:16', 1, NULL),
(29, '335323586336510_122134036880361405', 'share', 'share', 'In the world of tech, savings often feel like elusive unicorns—amazing when spotted, but difficult to nail down. Enter the latest Google sale, a spectacular opp where prices on Pixel phones are slashed, presenting buyers with the perfect chance to snag these high-performance gadgets at a fraction of their usual cost. Think of it as a brief yet glorious window through which you can step into the realm of premium Android experiences without burning a hole in your pocket. But wait, there’s more—this isn’t your everyday clearance. There’s an exclusive code that promises to amplify these savings even further. How’s that for cherry on top?', '335323586336510', 30, 30, 3, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:28:18', '2024-10-01 23:28:18', 3, NULL),
(30, '335323586336510_122134015286361405', 'video_inline', 'videos', 'Shigeru Ishiba\'s election as leader of Japan\'s ruling Liberal Democratic Party has sent ripples through financial markets. In this video, we delve into the implications of his victory over Takaichi, signaling a shift towards tighter monetary policy and a stronger yen. Discover how Ishiba\'s commitment to structural reforms and long-term stability seeks to tackle Japan\'s pressing demographic challenges. Join us as we explore what this leadership change means for Japan\'s economic landscape and global financial dynamics.\n\nDon\'t forget to like and share this video to keep the discussion going!\n#ShigeruIshiba #LiberalDemocraticParty #JapanEconomy #MonetaryPolicy #FinancialMarkets #DemographicChallenges #EconomicStability', '335323586336510', NULL, NULL, NULL, 0, 1, 94, 91, 87, 7, NULL, NULL, NULL, NULL, '2024-10-01 23:28:20', '2024-10-01 23:28:20', NULL, NULL),
