(95, '114156610459218_114207983787414', 'photo', 'photo', 'TẬP AEROBIC - GIẢM NGUY CƠ MẮC BỆNH\n\nTác dụng của tập aerobic sẽ giúp bạn:\n\n🤸 Ngăn ngừa loãng xương\n🤸 Hạ huyết áp và kiểm soát lượng đường trong máu\n🤸 Kiểm soát bệnh động mạch vành tốt hơn\n🤸 Giảm nguy cơ mắc các bệnh như béo phì, huyết áp cao, tiểu đường tuýp 2, hội chứng chuyển hóa, đột quỵ và một số bệnh ung thư\n🤸 Tăng lipoprotein mật độ cao (cholesterol tốt – HDL) và giảm lipoprotein mật độ thấp (cholesterol xấu – LDL)\n🤸 Ngăn ngừa chứng suy giảm nhận thức\n🤸 Tăng cường hệ miễn dịch, phòng tránh các bệnh do virus gây ra như cảm lạnh, cảm cúm…\n\n🤸‍♀️🤸‍♂️🤸Nghiên cứu cho thấy, những người luyện tập aerobic thường sống lâu hơn những người không tập thể dục thường xuyên.🤸‍♀️🤸‍♂️🤸', '114156610459218', 47, 47, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:29:09', '2024-10-01 23:29:09', 0, NULL),
(96, '114156610459218_114202510454628', 'photo', 'photo', 'Tác dụng tuyệt vời của việc luyện tập yoga hàng ngày:\n\n🧘‍♀️🧘‍♀️ Tập yoga rèn luyện sức bền bỉ\n\n🧘‍♀️🧘‍♀️ Tập Yoga giúp bạn tĩnh hơn\n\n🧘‍♀️🧘‍♀️ Tập Yoga giúp cải thiện bệnh lý\n\n🧘‍♀️🧘‍♀️ Tập Yoga giúp bạn cân bằng lại cuộc sống\n\n🧘‍♀️🧘‍♀️ Tập Yoga giúp bạn kiểm soát được cân nặng\n\n🧘‍♀️🧘‍♀️ Tập Yoga giúp ổn định huyết áp\n\n🧘‍♀️🧘‍♀️ Tập Yoga tốt cho xương khớp', '114156610459218', 34, 34, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-01 23:29:10', '2024-10-01 23:29:10', 0, NULL),
