(24, '335323586336510', '335323586336510_122131707458361405', 'The stage is set for an intense showdown as Stoke City faces off against Hull City! With both teams eager to secure crucial points, every moment will count. From thrilling goals to stunning saves, we’re in for a treat! What are your predictions for today’s match? Let’s get the conversation going and support our teams! 🙌⚽️ #EFLChampionship #SoccerFans #StokeVsHull', '2024-09-23 13:52:23', '2024-09-23 13:52:23', 1, 0, 0),
(25, '335323586336510', '335323586336510_122131688378361405', 'On a crisp autumn morning, Huawei unveiled a groundbreaking addition to their tech arsenal—two new Android tablets equipped with their distinctive PaperMatte anti-glare screens. This announcement has stirred the tech community, sparking both curiosity and excitement. As the digital world is abuzz with predictions of what these tablets might herald, let’s dive into the details surrounding this innovative technology and its implications for the future of handheld devices.', '2024-09-23 13:52:24', '2024-09-23 13:52:24', 1, 0, 0),
(26, '335323586336510', '335323586336510_122131639028361405', 'In a series of unfolding events that has sent ripples across the geopolitical landscape, U.S. officials have come forward with startling revelations. They assert that Iran is actively aiding Yemen’s Houthi rebels in targeting and downing U.S. Reaper drones. This marks a significant escalation in the already tumultuous Middle Eastern theater, where proxy wars and direct confrontations have become the unsettling norm.', '2024-09-23 13:52:24', '2024-09-23 13:52:24', 4, 0, 1),
