(28, '335323586336510', '335323586336510_122131512356361405', 'In a riveting showdown at Ninoy Aquino Stadium, the Converge FiberXers delivered a game to remember, edging out Meralco Bolts with a 105-97 victory. Alec Stockton emerged as the hero of the night, knocking down crucial shots in the dying moments to seal the win and elevate Converge’s standing in Group A of the PBA Governors’ Cup.', '2024-09-23 13:52:26', '2024-09-23 13:52:26', 1, 0, 0),
(29, '335323586336510', '335323586336510_122131464866361405', 'Debbie Harry, the iconic frontwoman of Blondie, has proven once again that age is just a number. At 79 years old, she has left fans and critics alike in awe with her recent appearance in a new eyewear campaign video. It’s almost as if she has discovered the fountain of youth, blending timeless beauty with her signature rock-and-roll edge. This isn’t just about fashion; it’s a testament to her enduring influence in the music and style industries.', '2024-09-23 13:52:26', '2024-09-23 13:52:26', 4, 0, 1),
(30, '335323586336510', '335323586336510_122131435562361405', 'In a groundbreaking medical feat, cardiac surgeons at the King Faisal Specialist Hospital and Research Center (KFSHRC) in Saudi Arabia performed the world’s first robotic heart surgery on a 16-year-old patient suffering from end-stage heart failure. This historic procedure, reported by the healthcare news website Cardiovascular Business, marks a significant leap forward in the field of cardiac care, illustrating the growing role of robotics in medical treatment.', '2024-09-23 13:52:27', '2024-09-23 13:52:27', 0, 0, 0),
(31, '335323586336510', '335323586336510_122131335230361405', 'Mark your calendars for September 19, 2024, at 4:00 PM Eastern Time for the Virtual Investor Closing Bell Series! Join us as CEO Russell Trenary unveils the groundbreaking approval of a new treatment for wet age-related macular degeneration in Europe and the UK. Gain exclusive insights into the European success story and hear firsthand about our strategic goals and ambitious expansion plans into the United States. Don’t miss this opportunity to stay ahead in the investment world and learn about this innovative advancement in eye care.\n\nLike and share this video to spread the word!\n\n#InvestorSeries #VirtualEvent #CEOAnnouncement #MacularDegeneration #HealthcareInnovation #InvestmentOpportunities #USExpansion', '2024-09-23 13:52:28', '2024-09-23 13:52:28', 0, 0, 0),
(32, '335323586336510', '335323586336510_122131315064361405', 'Step into nostalgia with Trigger\'s latest masterpiece in their Transformers tribute video! Relive the golden era with awe-inspiring animation quality and mind-blowing transformation sequences that showcase meticulous detail. Experience the breathtaking soundtrack that perfectly complements each action-packed moment, making this a must-watch for both long-time fans and newcomers to the Transformers universe. Don\'t miss out on this tribute that perfectly blends the past and the present!\n\nEnjoyed the video? Give it a thumbs up and share it with fellow Transformers enthusiasts!\n\n#Transformers #Animation #Nostalgia #Trigger #TributeVideo #80sCartoons #TransformAndRollOut', '2024-09-23 13:52:29', '2024-09-23 13:52:29', 1, 0, 0),
(33, '335323586336510', '335323586336510_122131304912361405', 'In the high-stakes world of professional football, it’s often said that games are won and lost in the trenches. The Chicago Bears, a team historically renowned for its fierce defenses, are once again proving this adage true with a remarkable performance on the line of scrimmage. This season, the Bears have quietly been dominating an essential metric that could make or break their playoff hopes: the efficiency of their offensive and defensive lines.', '2024-09-23 13:52:29', '2024-09-23 13:52:29', 1, 0, 0),
(34, '335323586336510', '335323586336510_122131266686361405', 'iOS 18 vs iOS 17: What’s New?\nDiscover the future of mobile tech with our latest video! Dive into the world of *Smart Widgets* that intelligently adapt to your habits, providing proactive information right when you need it. Explore the upgraded *Dynamic Island*, now fully interactive, enabling seamless control over your music, notifications, and messages. Plus, get hands-on with the enhanced camera features, including *ProRAW editing* directly within the Photos app. Elevate your mobile experience with these cutting-edge innovations! If you enjoyed the video, please like and share it with your friends! #SmartWidgets #DynamicIsland #ProRAW #MobileTech #TechInnovation #SmartphoneFeatures', '2024-09-23 13:52:30', '2024-09-23 13:52:30', 0, 0, 0),
(35, '335323586336510', '335323586336510_122131257404361405', 'In a world where freedom often means being tethered to a predictable path, the Rubishack shatters conventional living with a robust declaration of independence. It’s not just a tiny house; it’s a revolution on wheels, daring anyone to embrace the wilderness. Mounted on a formidable Cummins truck, the Rubishack is engineered to brave the untamed landscapes that lay beyond the beaten tracks. Imagine rolling over rugged terrain, gliding past daunting obstacles, and finding solace in nature’s heart, all the while having your entire home right behind you.', '2024-09-23 13:52:31', '2024-09-23 13:52:31', 1, 0, 0),
(36, '335323586336510', '335323586336510_122131116074361405', 'Discover the unfolding controversy around the ₹52 crore allocated for reconstructing the Hatkeshwar flyover. Opposition parties are raising alarms about potential irregularities, sparking a heated debate. Built in 2017 and closed in 2022 due to structural issues, the flyover\'s demolition and reconstruction have left the public skeptical despite government assurances on safety and cost recovery from the original contractor. Join us as we explore the pressing demands for transparency and an independent audit. Don\'t miss out on this deep dive into a critical infrastructure issue affecting many. #HatkeshwarFlyover #InfrastructureIssues #PublicTransparency #GovernmentAccountability #ConstructionControversy #FlyoverReconstruction #PublicSafety', '2024-09-23 13:52:32', '2024-09-23 13:52:32', 0, 0, 0),
(37, '335323586336510', '335323586336510_122131101134361405', 'Robert Jenrick\'s proposal to cut over 100,000 civil service jobs aims to create a more efficient government. While supporters believe this move will streamline operations, critics voice concerns about the potential negative impact on public services and job security. Public opinion is sharply divided: civil servants express anxiety over their future, while some small business owners see potential benefits. Join us as we explore the different perspectives and implications of this controversial decision. Don\'t forget to like and share this video if you found it informative.\n\n#CivilServiceCuts #RobertJenrick #GovernmentEfficiency #PublicServices #JobSecurity #SmallBusiness #PublicOpinion', '2024-09-23 13:52:32', '2024-09-23 13:52:32', 0, 0, 0),
(38, '335323586336510', '335323586336510_122131086614361405', 'Rocket Lab\'s successful launch of the \'Photon\' satellite has created a surge in their stock value, showcasing the power of technological advancements in the aerospace industry. Meanwhile, Rentokil is grappling with supply chain issues and labor shortages, leading to a profit warning and a decline in investor confidence. This video delves into the contrasting performances of Rocket Lab and Rentokil, illustrating the volatility and critical need for innovation within the industrial sector. Don\'t forget to like and share this video to stay updated on the latest market trends and industry innovations!\n\n#RocketLab #PhotonSatellite #Rentokil #StockMarket #IndustryTrends #Innovation #InvestmentNews', '2024-09-23 13:52:33', '2024-09-23 13:52:33', 0, 0, 0),
(39, '335323586336510', '335323586336510_122131063988361405', 'Discover the vibrant world of sunglasses and learn how color can redefine your style! We\'ll dive into the impact of color on sunglasses and highlight various iconic brands. Explore unique styles from Cartier, Ray-Ban, Leisure Society, Oakley, Tom Ford, Fendi, Gucci, Gentle Monster, and Versace. Whether you\'re into classic elegance or bold statements, there\'s a perfect pair for you. Embrace colorful sunglasses to reflect your personality and make a lasting impression! If you enjoyed this video, please like and share it. #SunglassesStyle #ColorfulShades #FashionEyewear #DesignerSunglasses #RayBan #Gucci #Versace #TomFord', '2024-09-23 13:52:34', '2024-09-23 13:52:34', 0, 0, 0),
(40, '335323586336510', '335323586336510_122131054454361405', 'Witness Bryony Smith\'s impressive return to the T20 team as she smashes 58 runs off just 30 balls, showcasing her exceptional form! See debutant Charis Pavely make her mark with a standout performance, taking three crucial wickets and helping secure a commanding victory. Discover how the England team blends experience and youth, proving their strength on the field in this thrilling T20 match. Don\'t miss out on the action-packed highlights! Enjoy the video? Make sure to like and share with fellow cricket fans!\n\n#BryonySmith #CharisPavely #T20Cricket #EnglandCricket #CricketHighlights #Sports #CricketLovers #Victory', '2024-09-23 13:52:35', '2024-09-23 13:52:35', 0, 0, 0),
(41, '335323586336510', '335323586336510_122131047224361405', 'Get ready for the launch of the vivo X200 Pro on October 14th in Beijing! This cutting-edge smartphone is set to revolutionize the market with its powerful Dimensity 9400 chipset, delivering an impressive 30% boost in single-core performance. Say goodbye to long charging times, as the vivo X200 Pro\'s fast-charging capabilities have been confirmed through 3C certification, ensuring you stay powered up in no time. Don\'t miss out on this game-changing device! If you enjoyed this video, remember to like and share! #vivoX200Pro #SmartphoneLaunch #Dimensity9400 #FastCharging #TechNews', '2024-09-23 13:52:35', '2024-09-23 13:52:35', 0, 0, 0),
(42, '335323586336510', '335323586336510_122131042550361405', 'In a digital age where reboot announcements and nostalgia-packed clips dominate social media feeds, something extraordinary happened. Celebrating the long-lasting legacy of the Transformers franchise, animation studio Trigger dropped a music video that can only be described as a love letter to fans. This isn’t just any video; this is an audacious, high-energy tribute that captures the very essence of what makes the Robots in Disguise an evergreen phenomenon.', '2024-09-23 13:52:36', '2024-09-23 13:52:36', 0, 0, 0),
(43, '335323586336510', '335323586336510_122130886352361405', 'A tragic incident involving a dedicated railway staff member underscores the critical need for enhanced safety measures. This video delves into the importance of regular health check-ups, immediate medical facilities, and effective communication to safeguard workplace environments. We\'ll explore how the railway industry can benefit from adopting stringent safety protocols akin to those in aviation, such as comprehensive risk assessments and immersive training simulations. Join us as we advocate for a safer future for all railway personnel. #RailwaySafety #WorkplaceSafety #HealthCheckUps #SafetyProtocols #RiskAssessment #TrainSafety #RailwayIndustry #SafetyMeasures', '2024-09-23 13:52:37', '2024-09-23 13:52:37', 0, 0, 0),
(44, '335323586336510', '335323586336510_122130854780361405', 'In a recent announcement that has sparked conversations across the gaming community, Sony’s top executive addressed a contentious topic: the ongoing debate between PC gaming and consoles. The focus has been particularly sharp following the release and subsequent sticker shock of the PS5 Pro. With many gamers contemplating whether to invest in a high-end console or channel their resources into building a customized gaming PC, it seems the scales of preference are tipping in intriguing directions.', '2024-09-23 13:52:38', '2024-09-23 13:52:38', 1, 0, 0),
(45, '115893248195608', '115893248195608_197735996692614', '🎉 Mùa lễ hội cuối năm - Khoảnh khắc đáng nhớ bên người thân và bạn bè. Với SONG HÀNH HỘI QUÁN, mọi phút giây đều trở nên ngọt ngào và đáng nhớ hơn! 🥂\n\n🎈 Những tháng cuối năm, tình cảm và tri ân đong đầy mỗi khi ta ngồi cùng nhau. Đừng để những lo lắng về địa điểm hay giá cả làm mất đi phần vui! SONG HÀNH HỘI QUÁN đồng hành cùng bạn với những ưu đãi đặc biệt:\n\n✨ Giảm ngay % trên tổng bill.\n✨ Thưởng thức món ngon tặng kèm hàng ngày.\n✨ Uống bia, nước giải khát với giá ưu đãi tốt nhất.\n✨ Nhận ngay voucher cho lần tiếp theo bạn ghé thăm chúng tôi.\n\n🌟 Hãy để mỗi khoảnh khắc bên người thân trở nên đáng nhớ hơn cùng SONG HÀNH HỘI QUÁN! 🥳\n\n⭐️⭐️⭐️⭐️⭐️\n🎯 17 Song Hành, phường An Phú, TP. Thủ Đức\n☎️ HOTLINE:  0327.37.11.66\n💻 Website: https://songhanhhoiquan.com', '2024-09-23 13:52:44', '2024-09-23 13:52:44', 93, 150, 0),
(46, '115893248195608', '115893248195608_191155864017294', '⭐️⭐️⭐️ Song Hành Hội Quán ⭐️⭐️⭐️\n🎯 17 Song Hành, phường An Phú, TP. Thủ Đức\n☎️ HOTLINE:  0327.37.11.66\n💻 Website: https://songhanhhoiquan.com\n𝐇𝐮̛𝐨̛𝐧𝐠 𝐕𝐢̣ Đ𝐚 𝐃𝐚̣𝐧𝐠 𝐂𝐡𝐨 𝐌𝐨̣𝐢 𝐓𝐡𝐮̛̣𝐜 𝐊𝐡𝐚́𝐜𝐡\n\nBạn đang tìm kiếm một địa điểm lý tưởng để tổ chức tiệc? Hãy để Song Hành Hội Quán mang đến cho bạn trải nghiệm ẩm thực độc đáo và hoàn hảo. Với chúng tôi, bạn sẽ được thỏa mãn với một bữa tiệc tuyệt vời đáp ứng mọi sở thích về món ăn.\n\nChúng tôi tự hào giới thiệu một thực đơn đa dạng với sự kết hợp hoàn hảo giữa các món ăn Việt Nam truyền thống, đặc sản Á, Âu và hải sản tươi sống. Tận hưởng các món hải sản tươi sống như hàu, mực, cua, và nhiều loại hải sản khác, chế biến theo cách tối ưu để bảo tồn hương vị tốt nhất.\n\nBạn có thể lựa chọn giữa tiệc buffet phong cách tự phục vụ hoặc dịch vụ gọi món. Song Hành Hội Quán có khả năng đón tiếp từ tiệc nhỏ tư gia cho đến tiệc công ty quy mô lớn lên đến 100 thực khách. Chúng tôi cam kết đảm bảo dịch vụ hoàn hảo và không gian thoải mái cho tất cả khách hàng của bạn.\n\nNếu bạn đang tìm kiếm một nơi để tổ chức tiệc chất lượng và đáng nhớ, hãy liên hệ với chúng tôi tại Song Hành Hội Quán. Chúng tôi sẽ làm cho mỗi sự kiện của bạn trở thành một trải nghiệm ẩm thực độc đáo và đáng nhớ. Đừng bỏ lỡ cơ hội này! Đặt tiệc của bạn ngay hôm nay để nhận được nhiều ưu đãi và tận hưởng những hương vị tuyệt vời.\n\n#SongHànhHộiQuán #TiệcTạiNhàHàng #HươngVịĐaDạng #DịchVụTiệc', '2024-09-23 13:52:45', '2024-09-23 13:52:45', 130, 153, 4),
